import React, { useState } from 'react'

const Login = () => {

    const [user, useState ] = useState({
        email: '',
        password: ''
    });

    const { email, password } = user;

    const onChange = e =>({ ...user, [e.target.name]: e.target.value});

    const onSubmit = e => {
        e.preventdefault();
        console.log('Login submit')
    }

    return (
        <div className= 'form-cotainer'>
            <h1>
                Acount <span className="text-primary">Login</span>
            </h1>
            <form onSubmit={onSubmit}>
                <div className="form-group">
                    <label htmlFor="name">Email Address</label>
                    <input type="email" name="email" value={email} onChange={onChange} />
                </div>
                <div className="form-group">
                    <label htmlFor="name">Password</label>
                    <input type="passsword" name="password" value={password} onChange={onChange} />
                </div>
                <input type="submit" value="Login" className="btn btn-primary btn-block" />
                {/* <input type="submit" value="Register" className="btn btn-primary btn-block" /> */}
            </form>
        </div>
    )
}

export default Login;
